 --select * from attributes

    , eval_services AS (
    SELECT ev.id as evaluation_id,
           a.service_name AS service_name,
           a.service_name as service_id,
           alloy_result as alloy_result
    FROM alloy_evaluations ev 
        cross join (select distinct service_name
                    from attributes ) a
    where 1=1
 --      and updated_at::date >= now()::date - 1
 --      	and ev.id = 65000
    ) 
    
    --select * from eval_services ;
    

    , service_selector AS (
    SELECT a.service_name,
           a.selector,
           replace(replace(replace(a.selector, '.', ', '), '[', ', '), ']', '') AS selector_path,
           a.data_type,
           a.display_name AS field_display_name,
           a.name AS field_name,
           a.description AS field_description,
           a.data_source,
           a.source_type
    FROM attributes a
    )
    
    --select * from  service_selector;
   
    , raw_eval_fields AS (
    SELECT es.evaluation_id,
           es.service_id,
           es.service_name,
           ss.field_name,
           ss.field_display_name,
           case 
            when length(ss.selector_path) > 0
            then es.alloy_result #>> format('{raw_responses, %s, 0, %s, %s}' :: text, es.service_name, ss.selector_path, ss.field_name) :: text [] 
            else es.alloy_result #>> format('{raw_responses, %s, 0, %s}' :: text, es.service_name, ss.field_name) :: text [] end AS extracted,
           ss.field_description,
           ss.data_source,
           ss.data_type,
           'raw atttrs' :: text AS provenance
    FROM eval_services es
           JOIN service_selector ss USING (service_name)
    WHERE ss.data_source = 'raw'
    )
    
    --select * from raw_eval_fields ;
    
    , asp AS (
    SELECT es.evaluation_id,
           es.service_id,
           es.service_name,
           ss.field_name,
           ss.field_display_name,
           case 
            when length(ss.selector_path) > 0
            then es.alloy_result #>> format('{%s, %s}' :: text, ss.selector_path, ss.field_name) :: text [] 
            else es.alloy_result #>> format('{%s}' :: text, ss.field_name) :: text [] end AS extracted,           
           ss.field_description,
           ss.data_source,
           ss.data_type,
           'asp_atttrs' :: text AS provenance
    FROM eval_services es
           JOIN service_selector ss USING (service_name)
    WHERE ss.source_type = 'asp'
    )
    --select * from asp;

    , formatted_eval_fields AS (
    SELECT es.evaluation_id,
           es.service_id,
           es.service_name,
           ss.field_name,
           ss.field_display_name,
           es.alloy_result #>> format('{formatted_responses, %s, %s, %s}' :: text, es.service_name, ss.selector_path, ss.field_name) :: text [] AS extracted,
           ss.field_description,
           ss.data_source,
           ss.data_type,
           'formatted_attrs' :: text AS provenance
    FROM eval_services es
           JOIN service_selector ss USING (service_name)
    WHERE ss.data_source = 'formatted'
    )
    --select * from formatted_eval_fields;
        
    , non_reasoncodes AS (
        SELECT *
        FROM formatted_eval_fields
        UNION ALL
        SELECT *
        FROM raw_eval_fields
        UNION ALL
        SELECT *
        FROM asp
    )
--    select * from non_reasoncodes;
    
    ,disambig_attrs AS (
    SELECT nrc.*,
           ROW_NUMBER () OVER (
             PARTITION BY service_name || field_display_name
             ORDER BY CASE WHEN extracted IS NOT NULL THEN 0 ELSE 1 END DESC
             ) AS rn
    FROM non_reasoncodes nrc
    --WHERE service_id IN (80)
    )
    
--select * from disambig_attrs;
    , dedupe_attrs AS (
    SELECT evaluation_id,
           service_id,
           service_name,
           field_name,
           field_display_name,
           extracted,
           field_description,
           data_source,
           data_type,
           'deduped attrs' :: text AS provenance
    FROM disambig_attrs
    WHERE rn = 1
    )
--select * from dedupe_attrs    ;
 
    , combined AS (
    SELECT evaluation_id,
           service_id,
           service_name,
           field_name,
           field_display_name,
           extracted,
           field_description,
           data_source,
           data_type,
           provenance
    FROM non_reasoncodes
    )
--select * from combined;

SELECT  evaluation_id,
       service_id,
       service_name,
       field_name,
       service_name || '_' || field_display_name as field_display_name,
       extracted,
       field_description,
       data_source,
       data_type,
       provenance
FROM combined
       JOIN alloy_evaluations ev ON combined.evaluation_id = ev.id
where 1=1
  and extracted is not null
--   and service_name ilike '%Socure 30%'  
